ugin for those focused on speed'=>'Plugin mandiri gratis bagi mereka yang berfokus pada kecepatan','Enable improvements in one click'=>'Mengaktifkan perbaikan dengan mudah','Check your site performance'=>'Memeriksa performa situs Anda','Jetpack Boost gives your site the same performance advantages as the world’s leading websites, no developer required.'=>'Jetpack Boost memberikan manfaat performa situs yang sama dengan situs web terkemuka di dunia, tanpa bantuan pengembang.','Backup Product FeatureOne-click restores'=>'Pemulihan yang mudah','Backup Product Feature30-day archive & activity log*'=>'Arsip & log aktivitas dalam 30 hari*','Backup Product Feature10GB of backup storage'=>'Ruang penyimpanan cadangan sebesar 10 GB','Backup Product FeatureReal-time cloud backups'=>'Pencadangan cloud real time','Never lose a word, image, page, or time worrying about your site with automated backups & one-click restores.'=>'Tidak ada kata, gambar, halaman, atau waktu yang hilang karena mengkhawatirkan situs Anda dengan pencadangan otomatis & pemulihan yang mudah.','Save every change'=>'Simpan setiap perubahan','Anti-Spam Product FeatureAdvanced stats'=>'Statistik tingkat lanjut','Anti-Spam Product FeatureBlock spam without CAPTCHAs'=>'Blokir spam tanpa CAPTCHA','Anti-Spam Product FeatureComment and form spam protection'=>'Perlindungan spam untuk komentar dan formulir','Save time and get better responses by automatically blocking spam from your comments and forms.'=>'Hemat waktu dan dapatkan tanggapan yang lebih baik dengan memblokir spam secara otomatis dari komentar dan formulir Anda.','Stop comment and form spam'=>'Hentikan spam pada komentar dan formulir','Unable to fetch the products list from WordPress.com'=>'Tidak dapat memuat daftar produk dari WordPress.com','Your site is not connected to Jetpack.'=>'Situs Anda tidak terhubung dengan Jetpack.','The product class handler is not implemented'=>'Handler kelas produk tidak diterapkan','The product argument must be a string.'=>'Argumen product harus berupa string.','Production action to execute'=>'Kegiatan produksi yang harus dijalankan','Product slug'=>'Slug produk','My Jetpack'=>'Jetpack Saya','Last heartbeat sent at: %s'=>'Terakhir dikirim dengan cepat di:  %s','%s is not a valid command.'=>'%s bukanlah perintah yang sah.','Invalid blog token'=>'Token blog tidak valid','Invalid token for user %d'=>'Token untuk pengguna tidak valid %d','No blog token found'=>'Token blog tidak ditemukan','Requesting user_id %1$d does not match token user_id %2$d'=>'Meminta user_id %1$d tidak cocok dengan token user_id %2$d','Token for user %d is malformed'=>'Token untuk pengguna %d salah dibuat','No token for user %d'=>'Tidak ada token untuk pengguna %d','No primary user defined'=>'Pengguna utama tidak ditentukan','No user tokens found'=>'Token pengguna tidak ditemukan','You need to register your Jetpack before connecting it.'=>'Anda perlu mendaftarkan Jetpack Anda sebelum menghubungkannya.','An administrator for this blog must set up the Jetpack connection.'=>'Seorang administrator blog ini harus mengatur sambungan Jetpacknya.','Secret mismatch'=>'Ketidaksesuaian kode rahasia','Verification secrets are incomplete'=>'Kode rahasia verifikasi tidak lengkap','Verification secrets are empty'=>'Kode rahasia verifikasi kosong','Verification took too long'=>'Verifikasi terlalu lama','Verification secrets not found'=>'Kode rahasia verifikasi tidak ditemukan','The required "%s" parameter is malformed.'=>'Parameter wajib "%s" salah format.','The required "%s" parameter is missing.'=>'Parameter wajib "%s" tidak ditemukan.','Failed to disconnect the site as it appears already disconnected.'=>'Gagal memutus sambungan situs. Tampaknya situs sudah terputus.','Site is not connected'=>'Situs tidak terhubung.','Invalid user id is provided'=>'ID pengguna yang disertakan tidak valid','Invalid user token is provided'=>'Token pengguna yang disertakan tidak valid','Unable to verify your request.'=>'Tidak dapat memveri